import "bootstrap/dist/css/bootstrap.min.css";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import Navbar from "react-bootstrap/Navbar";
import NavDropdown from "react-bootstrap/NavDropdown";

function CollapsibleExample() {
  return (
    <Navbar collapseOnSelect className="collapseOnSelect" expand="lg" color = "black" >
      <Container>
        <Navbar.Brand href="/">EventEase</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto"></Nav>
          <Nav>
            <Nav.Link href="/">Home</Nav.Link>
            <Nav.Link href="/services">Services</Nav.Link>
            <Nav.Link href="events">Events</Nav.Link>
            <Nav.Link href="aboutus">About Us</Nav.Link>
            <Nav.Link href="contactus">Contact Us</Nav.Link>

            <NavDropdown title="Customer Name" id="collasible-nav-dropdown">
              <NavDropdown.Item href="profile">Profile</NavDropdown.Item>

              <NavDropdown.Item href="appointments">
                Appointments{" "}
              </NavDropdown.Item>

              <NavDropdown.Item href="bookings">Bookings</NavDropdown.Item>
              <NavDropdown.Divider />

              <NavDropdown.Item href="#action/3.4"> Log Out </NavDropdown.Item>
            </NavDropdown>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default CollapsibleExample;
